import React, { Component } from 'react'
const Context = React.createContext();
export class Provider extends Component {
    state = {
        contacts : [
            { id: 1, nom: 'mohammed bjj', tel:'0222645654', email: 'med@kke.com'},
            { id: 2, nom: 'mohammed sss', tel:'02225445654', email: 'meddd@kke.com'},
            { id: 3, nom: 'mohammed ddd', tel:'0222665654', email: 'mezzzd@kke.com'}
        ]
    }
    render() {
        return (
            <Context.Provider value = {this.state} >
                { this.props.children }
            </Context.Provider>
        )
    }
}


export const Consumer = Context.Consumer;
